import "./List.css";

export default class List extends Component {
  render() {
    console.log(this);
    // 解构赋值，拿到props传过来的数据
    const { todo } = this.props;
    return (
      <div className="listWrapper">

      {
          todo.map((todoObj) => {
              return(
                  <li>
                      <label >
                          <input type="checkbox"/>
                          <span>{todoObj.name}</span>
                      </label>
                      <button className="btn btn-danger"  style={{display:'none'}}>删除</button>
                  </li>
              )
              
          }
          )
      }
